import React from "react";
import { Route } from "react-router-dom";
import ListingPage from "./pagesListingPage";

function DisplayRentals() {
    return (
        <div>
            <h1>Display Rentals</h1>
            <Route path="/rentals/:id" component={ListingPage} />
        </div>
    );
}

export default DisplayRentals;
